import * as React from 'react';
import { styled, createTheme, ThemeProvider } from '@mui/material/styles';
import CssBaseline from '@mui/material/CssBaseline';
import MuiDrawer from '@mui/material/Drawer';
import Box from '@mui/material/Box';
import MuiAppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import List from '@mui/material/List';
import Typography from '@mui/material/Typography';
import Divider from '@mui/material/Divider';
import IconButton from '@mui/material/IconButton';
import Badge from '@mui/material/Badge';
import Container from '@mui/material/Container';
import Grid from '@mui/material/Grid';
import Paper from '@mui/material/Paper';
import Link from '@mui/material/Link';
import MenuIcon from '@mui/icons-material/Menu';
import LogoutIcon from '@mui/icons-material/Logout';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemText from '@mui/material/ListItemText';
import Avatar from '@mui/material/Avatar';

const drawerWidth = 360;

const mainListItems = (
    <React.Fragment>
        <ListItemButton>
            <Avatar sx={{ marginRight: '10px' }} src="" />
            <ListItemText primary="Luisa" />
        </ListItemButton>
        <Divider />
        <ListItemButton>
            <Avatar sx={{ marginRight: '10px' }} src="" />
            <ListItemText primary="Marta" />
        </ListItemButton>
        <Divider />
    </React.Fragment>
);


const Drawer = styled(MuiDrawer, { shouldForwardProp: (prop) => prop !== 'open' })(
    ({ theme }) => ({
        '& .MuiDrawer-paper': {
            position: 'relative',
            whiteSpace: 'nowrap',
            width: drawerWidth,
            boxSizing: 'border-box',
            [theme.breakpoints.up('sm')]: {
                width: drawerWidth,
            },
        },
    }),
);

// TODO remove, this demo shouldn't need to reset the theme.
const defaultTheme = createTheme();

export default function Chat() {
    const [open, setOpen] = React.useState(true);

    return (
        <ThemeProvider theme={defaultTheme}>
            <Box sx={{ display: 'flex', flexDirection: 'column', minHeight: '100vh' }}>
                <CssBaseline />
                <Box sx={{ flexGrow: 1 }}>
                    <MuiAppBar position="absolute" sx={{ bgcolor: '#ffffff', top: 'auto', bottom: 0 }}>
                        <Toolbar>
                            <Avatar sx={{ marginLeft: '340px' }} src="" />
                            <Typography
                                component="h1"
                                variant="h6"
                                color="black"
                                noWrap
                                paddingLeft={2}
                            >
                                Luisa
                            </Typography>
                        </Toolbar>
                    </MuiAppBar>
                    <Drawer variant="permanent">
                        <Toolbar
                            sx={{
                                display: 'flex',
                                alignItems: 'center',
                                justifyContent: 'space-between',
                                px: [1],
                            }}
                        >
                            <Box sx={{ display: 'flex', alignItems: 'center' }}>
                                <Avatar sx={{ marginRight: '10px' }} src="" />
                                <Typography
                                    variant="h7"
                                    color="inherit"
                                    noWrap
                                >
                                    Chat
                                </Typography>
                            </Box>
                            <IconButton color="inherit">
                                <LogoutIcon />
                            </IconButton>
                        </Toolbar>
                        <Divider />
                        <List component="nav">
                            {mainListItems}
                        </List>
                    </Drawer>
                    <Box
                        component="main"
                        sx={{
                            backgroundColor: (theme) =>
                                theme.palette.mode === 'light'
                                    ? theme.palette.grey[100]
                                    : theme.palette.grey[900],
                            flexGrow: 1,
                            overflow: 'auto',
                        }}
                    >
                        <Container sx={{ mt: 12, height: '100vh' }}>
                            <Grid container spacing={3}>

                            </Grid>
                            <MuiAppBar position="static" sx={{ bgcolor: '#ffffff', width: '100' }}>
                                <Toolbar>
                                    {/* Contenido del AppBar inferior */}
                                </Toolbar>
                            </MuiAppBar>
                        </Container>
                    </Box>
                </Box>
            </Box>
        </ThemeProvider>
    );
}
